		"text": "뮬란 광고판 부순 극장주…'극장 개봉' 옛말 되나 / SBS https://t.co/5V6xMWXM1x 디즈니가 뮬란을 온라인으로만 개봉하겠다고 하자 전세계의 극장주들이 분노. 이번 온라인 개봉이 성공하면 극장의 몰락이 본격화될지도. 하지만 디즈니플러스 없는 한국에서는 뮬란 극장 개봉 예정."
