		"text": "무언가를 주장하고자 쓴 글이 아니다. 다만, 남영동의 조그만 가게 하나가 닫는 일에 불과하지만, 그 가게가 어떻게 열리고 다시 닫히게 되었는 지에 조금은 더 많은 사람들이 기억해주었으면 하는 마음에서 썼다. 그리고 그곳에서 삶을 꾸려나간 어떤 사람들에 대해서도."
