		"full_text": "동교동 삼거리 근방에 위치했던 카페 한잔의 룰루랄라는 카레 맛집이자, 많은 이들의 안식처이자, 독립 예술가들의 아지트였다. 2019년 건물주가 재건축을 해야겠다며 돌연 나가라고 통보했다. 10여 년 간의 자영업에 이골이 나있던 룰사장 님도 싸우면서까지 카페를 계속 운영하기엔 여력이 없었다.",
