		"full_text": "레아 호프는 1993년부터 운영되었다. 거리의 오래된 터줏대감이었지만, 인근의 오래된 세입자와 주민들의 힘 만으로는 행정의 주도로 밀어붙여지는 재개발을 막을 수 없었다. 극한의 대립 속에서 여러 목숨이 사그러 들었고, 그러나 사그라든 목숨이 무색하게 그 이후로도 분쟁과 탄압이 이어졌다.",
