		"text": "인생 첫 마련한 내 집, 천장 뜯었더니 비빔밥·김치가 와르르 https://t.co/02GaiCENcR 인천 송도의 한 아파트. 천장에서 물방울이 떨어지고 도배지에 곰팡이가 생기기 시작. 뜯어보니 천장 빈 공간에 먹다 남긴 음식쓰레기와 건축폐기물. 입주 한 달 전 에어콘 설치공사를 한 기능공들이 그랬다고. https://t.co/L6eEamiAfE"
