		"full_text": "이것과 관련해서 민원을 넣었고(슬로워크의 이메일 글이나 펭도님의 글을 인용해 적었다.) 읽씹을 당하고 아직까지 답변을 받지 못했다. 언제쯤 보내줄지 기다리고 있지만 그대로 잊혀질 수도 있다 싶음. 신문고로 보낸 것이 아니라 시의 소통 창구로 열어둔 소셜채널로 보낸 것.  이유는 뒤에.",
